import React from "react";

import { Logo } from "../styles/Loading";

const Loading = () => {
	return (
		<div>
			<Logo>
				<img className="logo-image" src="/images/logo.png" />
			</Logo>
			<img />
			<p>
				Estamos buscando ...
				<br />
				espera un poco más Ü
			</p>
		</div>
	);
};

export default Loading;
